    <script>
      window.SimpleSpectrum = {};
      window.AudioContext = (function () {
        var q = window.AudioContext || window.webkitAudioContext;
        return function () {
          var ac = new q();
          window.SimpleSpectrum.ac = ac;
          window.SimpleSpectrum.a = ac.createAnalyser();
          window.SimpleSpectrum.a.smoothingTimeConstant = 0;
          window.SimpleSpectrum.fa = new Uint8Array(
            window.SimpleSpectrum.a.frequencyBinCount
          );
          window.SimpleSpectrum.la = new Uint8Array(window.SimpleSpectrum.a.fftSize);
          window.SimpleSpectrum.a.connect(ac.destination);
          ac.actualDestination = ac.destination;
          Object.defineProperty(ac, "destination", {
            value: window.SimpleSpectrum.a,
            writable: false
          });
          return ac;
        };
      })();
    </script>
    <script>
      var container = document.querySelector("#unity-container");
      var canvas = document.querySelector("#unity-canvas");
      var loadingCover = document.querySelector("#loading-cover");
      var loadingBar = document.querySelector("#unity-loading-bar");
      var progressBarEmpty = document.querySelector("#unity-progress-bar-empty");
      var progressBarFull = document.querySelector("#unity-progress-bar-full");
      var fullscreenButton = document.querySelector("#unity-fullscreen-button");
      var warningBanner = document.querySelector("#unity-warning");
      var spinner = document.querySelector(".spinner");
#if SHOW_DIAGNOSTICS
      var diagnostics_icon = document.getElementById("diagnostics-icon");
#endif
      function unityShowBanner(msg, type) {
        function updateBannerVisibility() {
          warningBanner.style.display = warningBanner.children.length
            ? "block"
            : "none";
        }
        var div = document.createElement("div");
        div.innerHTML = msg;
        warningBanner.appendChild(div);
        if (type == "error") div.style = "background: red; padding: 10px;";
        else {
          if (type == "warning") div.style = "background: yellow; padding: 10px;";
          setTimeout(function () {
            warningBanner.removeChild(div);
            updateBannerVisibility();
          }, 5000);
        }
        updateBannerVisibility();
      }
      var buildUrl = "Build";
      var loaderUrl = buildUrl + "/{{{ LOADER_FILENAME }}}";
      var config = {
        dataUrl: buildUrl + "/{{{ DATA_FILENAME }}}",
        frameworkUrl: buildUrl + "/{{{ FRAMEWORK_FILENAME }}}",
#if USE_THREADS
        workerUrl: buildUrl + "/{{{ WORKER_FILENAME }}}",
#endif
#if USE_WASM
        codeUrl: buildUrl + "/{{{ CODE_FILENAME }}}",
#endif
#if MEMORY_FILENAME
        memoryUrl: buildUrl + "/{{{ MEMORY_FILENAME }}}",
#endif
#if SYMBOLS_FILENAME
        symbolsUrl: buildUrl + "/{{{ SYMBOLS_FILENAME }}}",
#endif
        streamingAssetsUrl: "StreamingAssets",
        companyName: {{{ JSON.stringify(COMPANY_NAME) }}},
        productName: {{{ JSON.stringify(PRODUCT_NAME) }}},
        productVersion: {{{ JSON.stringify(PRODUCT_VERSION) }}},
        showBanner: unityShowBanner
      };
      if (/iPhone|iPad|iPod|Android/i.test(navigator.userAgent)) {
        container.className = "unity-mobile";
        canvas.className = "unity-mobile";
        config.devicePixelRatio = 1;
#if SHOW_DIAGNOSTICS
        diagnostics_icon.style.position = "fixed";
        diagnostics_icon.style.bottom = "10px";
        diagnostics_icon.style.right = "0px";
        canvas.after(diagnostics_icon);
#endif
      }
#if BACKGROUND_FILENAME
      canvas.style.background =
        "url('" +
        buildUrl +
        "/{{{ BACKGROUND_FILENAME.replace(/'/g, '%27') }}}') center / cover";
#endif
      var script = document.createElement("script");
      script.src = loaderUrl;
      script.onload = () => {
        createUnityInstance(canvas, config, (progress) => {
          progressBarFull.style.width = 100 * progress + "%";
        })
          .then((unityInstance) => {
#if SHOW_DIAGNOSTICS
            diagnostics_icon.onclick = () => {
              unityDiagnostics.openDiagnosticsDiv(unityInstance.GetMemoryInfo);
            };
#endif
            fullscreenButton.onclick = () => {
              unityInstance.SetFullscreen(1);
            };
            window.setTimeout(function () {
              return loadingCover.classList.add("hide-loader");
            }, 500);
          })
          .catch((message) => {
            alert(message);
          });
      };
      document.body.appendChild(script);
    </script>
  </body>
</html>
